  return (
    <>
      <div className="d-none" id="saldo">
        <Saldo />
      </div>
      <div className="d-none" id="movimientos">
        <Movimientos />
      </div>
      <div className="d-none" id="destinatarios">
        <Destinatarios />
      </div>
      <div className="d-none" id="LineaCredito">
        <LineaCredito />
      </div>
    </>
  );
};
